function CommonLogin() {    
    return (
      <> 
        <div class="card" style={{width: '18rem'}}>
         <img src={"https://static.vecteezy.com/system/resources/previews/005/519/978/original/cartoon-drawing-of-a-teacher-vector.jpg"} class="card-img-top" alt="..."/>
         <div class="card-body">
          <h5 class="card-title">Мұғалім</h5> 
         </div>
        </div>

        <div class="card" style={{width: '18rem'}}>
         <img src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} class="card-img-top" alt="..."/>
         <div class="card-body">
          <h5 class="card-title">Студент</h5> 
         </div>
        </div>
  
      </>
    );
  }
  
  export default CommonLogin;
